class New extends Component {
  render() {
    return(
      <div className="new_container">
        <h1> New Flash Card </h1>
        <div className="card_form">
          <input type="text" name="username" className="form-control" placeholder="Insert Title of Flash Card..." />
          <textarea placeholder="Input answers..." />
          <button> Submit </ button>
        </div>
      </div>
    )
  }
}

export default New;
